import React from "react";
import Dog from "../images/dog.jpg";
import Swal from 'sweetalert2';

const onBark = () => {
    Swal.fire("Woof! Woof!");
}

function DogDetails(){

    return (
        <div className="DogDetails">
            <button id="buttonAlert" onClick={ onBark }>Bark</button>
            <h1>Maylon</h1>
            <img src={ Dog } alt="dog"/>
        </div>
    );
}

export default DogDetails;
